from fastapi import FastAPI, Request
import requests, logging, asyncio, httpx
from fastapi.responses import HTMLResponse
from pydantic import BaseModel

app = FastAPI()
logging.basicConfig(level=logging.INFO, format="%(asctime)s - %(levelname)s - %(message)s")

API_KEY = "<APIKEY>"
API_URL = "https://api.freepik.com/v1/ai/text-to-image"

class MetaphorRequest(BaseModel):
    prompt: str

class GenerateRequest(BaseModel):
    prompt: str = "study at night"
    generate_metaphor: bool = False

def generate_ollama_response(model: str, prompt: str):
    url = "http://localhost:11434/api/generate"
    data = {"model": model, "prompt": prompt, "stream": False}

    try:
        response = requests.post(url, json=data).json()
        clean_text = response["response"].replace("\\n", "\n").replace('\\"', '"').strip()
        return clean_text
    except Exception as e:
        return f"Error: {str(e)}"

async def fetch_metaphor(prompt):
    loop = asyncio.get_event_loop()
    prompt_template = f"""
    Generate a high-quality 2D illustration prompt for AI image generation on the topic "{prompt}", designed as a symbolic metaphor representing the given concept. 
    The image should use familiar everyday objects, animals or tools and items to make the metaphor visually intuitive and memorable for the user. 
    The composition must be clear, well-structured, and spatially balanced, ensuring all elements serve a meaningful purpose in conveying the metaphor.
    Apply realistic textures and lighting,  using warm tones, soft shading, and vivid contrast to enhance depth and clarity. 
    The style should be semi-realistic, illustrated, or fantasy-inspired, depending on the concept. Avoid vague abstract representations, 
    ensuring the metaphor  remains visually distinct and immediately recognizable. Avoid adding any newlines, suffix, prefix, formatting texts, quotes.
    Example input 1: 'schedule a call with manager'
    Example output 1: 'a vintage rotary phone resting on an open planner with a glowing checkmark above to symbolize a confirmed meeting'
    Example input 2: 'pay electricity bill'
    Example output 3: 'a glowing light bulb gripping a receipt and illuminating it as a reminder to pay'
    Example input 3: 'take night medicine'
    Example output 3: 'an owl cradling a pill bottle in its talons under soft moonlight to convey nighttime healing'
    """
    return await loop.run_in_executor(None, lambda: generate_ollama_response("mistral", prompt_template)) #llama3.2

@app.post("/generate_metaphor")
async def generate_metaphor(request: MetaphorRequest):
    print(f"Metaphor generation triggered using prompt: {request.prompt}")
    metaphor = await fetch_metaphor(request.prompt)
    return {"metaphor": metaphor}

@app.post("/generate")
async def generate_image(request: GenerateRequest):
    prompt = request.prompt
    generate_metaphor = request.generate_metaphor
    logging.info(f"Received Prompt: {prompt}")
    if generate_metaphor:
        logging.info(f"Metaphor generation requested. Using the given string as input prompt...")
        async with httpx.AsyncClient(timeout=50.0) as client:
            metaphor_response = await client.post(
                "http://127.0.0.1:8000/generate_metaphor",
                json={"prompt": prompt}
            )
        logging.info(f"ollama response: {metaphor_response.json()}")

        if metaphor_response.status_code != 200:
            return {"error": "Failed to generate metaphor"}
        
        metaphor_prompt = metaphor_response.json().get("metaphor", "an owl sittign on a study desk and trying to read a book at night")
    else:
        metaphor_prompt = prompt
    payload = {
        "prompt": metaphor_prompt,
        "negative_prompt": "b&w, earth, cartoon, ugly",
        "guidance_scale": 2,
        "seed": 42,
        "num_images": 1,
        "image": {"size": "square_1_1"},
        "filter_nsfw": True
    }

    '''
    "styling": {
        "style": "photo",
        "effects": {
            "color": "pastel",
            "lightning": "warm",
            "framing": "portrait"
        },
        "colors": [
            {"color": "#FF5733", "weight": 1},
            {"color": "#33FF57", "weight": 1}
        ]
    }'''

    headers = {"Content-Type": "application/json", "x-freepik-api-key": API_KEY}

    # #  Dummy response
    # dummy_base64 = ""
    # return {"data": [{"base64": dummy_base64}]}

    response = requests.post(API_URL, json=payload, headers=headers)
    logging.info(f"Prompt: {prompt} | Base64 (first 10 chars): {response.json()["data"][0]["base64"][:10]}")
    # return response.json()
    image_base64 = response.json()["data"][0]["base64"]
    return {"prompt": prompt, "metaphor_prompt": metaphor_prompt, "image_data": response.json(), "image_base64": image_base64}
    
@app.get("/", response_class=HTMLResponse)
async def render_page():
    html_template = """
    <html>
    <body>
        <h2>Generate Image from Text</h2>
        <input type="text" id="prompt">
        <button onclick="generateImage()">Generate</button>
        <img id="generatedImage" style="display:none;">
        <script>
        async function generateImage() {
                let response = await fetch("/generate", {
                    method: "POST",
                    headers: { "Content-Type": "application/json" },
                    body: JSON.stringify({ "prompt": document.getElementById('prompt').value })
                });
                let data = await response.json();
                document.getElementById("generatedImage").src = "data:image/png;base64," + data.data[0].base64;
                document.getElementById("generatedImage").style.display = "block";
            }
        </script>
    </body>
    </html>
    """
    html_template = """
    <!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>MemoryMesh - Visual metaphor generator</title>
        <style>
            body { font-family: Arial, sans-serif; margin: 40px; text-align: center; }
            .form-container { max-width: 400px; margin: 0 auto; padding: 20px; border: 1px solid #ddd; border-radius: 10px; box-shadow: 0px 4px 10px rgba(0,0,0,0.1); }
            .toggle-container { display: flex; align-items: center; justify-content: center; margin: 10px 0; }
            .toggle-label { margin-left: 10px; font-weight: bold; }
            #generated-image { max-width: 100%; margin-top: 15px; border-radius: 8px; display: block; }
            #image-error { display: none; font-size: 18px; color: red; }
        </style>
    </head>
    <body>
        <div class="form-container">
            <h2>Generate an Image</h2>
            <form id="generate-form">
                <label for="prompt"><strong>Enter Prompt:</strong></label>
                <input type="text" id="prompt" name="prompt" required style="width:100%; padding: 8px; margin-top: 5px;">

                <div class="toggle-container">
                    <input type="checkbox" id="generate-metaphor" name="generate_metaphor">
                    <label class="toggle-label" for="generate-metaphor">Generate Metaphor First</label>
                </div>

                <button type="submit" style="margin-top: 10px; padding: 10px;">Generate</button>
            </form>

            <h3>Generated Metaphor:</h3>
            <p id="generated-metaphor" style="font-style: italic; color: #333;">Metaphor will appear here...</p>

            <h3>Generated Image:</h3>
            <img id="generated-image" src="" alt="⚠️ Image not available" onerror="this.style.display='none'; document.getElementById('image-error').style.display='block';">
            <p id="image-error">⚠️ Image could not be loaded.</p>
        </div>

        <script>
            document.getElementById("generate-form").addEventListener("submit", async function(event) {
                event.preventDefault();

                const prompt = document.getElementById('prompt').value;
                const generateMetaphor = document.getElementById('generate-metaphor').checked;

                let response = await fetch("/generate", {
                    method: "POST",
                    headers: { "Content-Type": "application/json" },
                    body: JSON.stringify({ "prompt": prompt, "generate_metaphor": generateMetaphor })
                });

                let data = await response.json();

                // Display generated metaphor
                document.getElementById("generated-metaphor").innerText = data.metaphor_prompt || "No metaphor generated.";

                // Handle image display
                const imgElement = document.getElementById("generated-image");
                if (data && data.image_base64) {
                    imgElement.src = "data:image/png;base64," + data.image_base64;
                    imgElement.style.display = "block";
                    document.getElementById("image-error").style.display = "none";
                } else {
                    imgElement.style.display = "none";
                    document.getElementById("image-error").style.display = "block";
                }
            });
        </script>
    </body>
    </html>
    """
    return HTMLResponse(html_template)
